puts "Inserting 10000 bands from bands_002.rb..."

# Resolve slug conflicts with existing bands before upserting
# Build map of slug -> musicbrainz_id for bands that own each slug
existing_slugs = {}
Band.pluck(:slug, :musicbrainz_id).each do |s, m|
  existing_slugs[s] = m if s.present?
end
bands_data.each do |band|
  slug = band[:slug]
  owner_mbid = existing_slugs[slug]
  # Conflict if slug is taken by a different band (different mbid or band has no mbid)
  if owner_mbid && owner_mbid != band[:musicbrainz_id]
    counter = 2
    base = slug
    while existing_slugs["#{base}-#{counter}"]
      counter += 1
    end
    band[:slug] = "#{base}-#{counter}"
  elsif existing_slugs.key?(slug) && owner_mbid.nil?
    # Slug taken by a band with no musicbrainz_id — must avoid it
    counter = 2
    base = slug
    while existing_slugs["#{base}-#{counter}"]
      counter += 1
    end
    band[:slug] = "#{base}-#{counter}"
  end
  existing_slugs[band[:slug]] = band[:musicbrainz_id]
end

# Use upsert_all to insert new records or update existing ones
Band.upsert_all(
  bands_data,
  unique_by: :musicbrainz_id,
  record_timestamps: false
)

puts "Done! Total bands in database: #{Band.count}"
